body.div:
FOR i := 0 TO 16 BY 1 DO
sTmp := DiagInfo_In[i];
sRet := '';
IF LEN(sTmp) > 0 THEN
WHILE LEN(sTmp) > 70 DO
sRet := CONCAT(sRet, LEFT(sTmp, 70));
sTmp := DELETE(sTmp, 70, 1);
iPos := FIND(sTmp, ' ');
IF iPos > 0 THEN
sRet := CONCAT(sRet, LEFT(sTmp, iPos));
sRet := CONCAT(sRet, BYTE_TO_STRING(BYTE#16#0D, '%c'));
sRet := CONCAT(sRet, BYTE_TO_STRING(BYTE#16#0A, '%c'));
sTmp := DELETE(sTmp, iPos, 1);
END_IF;
END_WHILE;
IF LEN(sTmp) > 0 THEN
sRet := CONCAT(sRet, sTmp);
END_IF;
END_IF;
DiagInfo_Out[i] := sRet;
END_FOR;

IF (INT_TO_WORD(IN) & WORD#16#F000) <> WORD#16#8000 THEN
ERROR := FALSE;
ERRCODE := WORD#0;
strTmp := REAL_TO_STRING(INT_TO_REAL(IN) / REAL#10.0, '%.1f °C');
strTmp := REPLACE(strTmp, ',', 1, FIND(strTmp, '.'));
ELSE
ERROR := TRUE;
ERRCODE := INT_TO_WORD(IN);
strTmp := '-,- °C';
END_IF;
STR := strTmp;

R_TRIG_1(CLK:=I_Zweihand);
TON_1(IN:=I_ZylLinksAs AND I_ZylRechtsAs,PT:=T#750MS);


IF NOT xAuto THEN
	RETURN;
END_IF;


IF I_NotAus OR xStoerung OR xZuHeissOderDefekt THEN
	Q_ZylLinksGs := xStoerung;
	Q_ZylLinksAs := FALSE;
	Q_ZylRechtsGs := xStoerung;
	Q_ZylRechtsAs := FALSE;
	Q_DruckerStart := FALSE;
	iStep := 0;
END_IF;


CASE iStep OF
	0:
		IF I_ZylLinksGs AND I_ZylRechtsGs THEN
			IF xTeilOK AND NOT I_TawLagerbuchseLinks AND NOT I_TawLagerbuchseRechts THEN
				Q_DruckerStart := Not I_Nachpressen;
			END_IF;


			xTeilOK := FALSE;
		END_IF;


		IF I_DruckluftOK AND R_TRIG_1.Q AND I_TawGewBuchseLinks AND I_TawGewBuchseRechts AND
		(I_TawLagerbuchseLinks Or (I_Nachpressen And Not I_TawLagerbuchseLinks)) AND
		(I_TawLagerbuchseRechts Or (I_Nachpressen And Not I_TawLagerbuchseRechts)) AND
		I_ZylLinksGs AND I_ZylRechtsGs AND ((I_DruckerBereit AND NOT I_DruckerFehler) Or I_Nachpressen) THEN
			Q_DruckerStart := FALSE;
			iStep := iStep + 1;
		END_IF;


		IF I_DruckluftOK AND R_TRIG_1.Q AND (NOT I_ZylLinksGs OR NOT I_ZylRechtsGs) THEN
			iStep := 100;
		END_IF;


	1:
		Q_ZylLinksAs := TRUE;
		Q_ZylRechtsAs := TRUE;


		IF TON_1.Q THEN
			xTeilOK := TRUE;
			Q_ZylLinksAs := FALSE;
			Q_ZylRechtsAs := FALSE;
			iStep := iStep + 1;
		END_IF;


	2:
		Q_ZylLinksGs := TRUE;
		Q_ZylRechtsGs := TRUE;


		IF I_ZylLinksGs AND I_ZylRechtsGs THEN
			Q_ZylLinksGs := FALSE;
			Q_ZylRechtsGs := FALSE;
			iStep := 0;
		END_IF;


	100:
		Q_ZylLinksAs := FALSE;
		Q_ZylLinksGs := TRUE;
		Q_ZylRechtsAs := FALSE;
		Q_ZylRechtsGs := TRUE;


		IF xTeilOK THEN
			xTeilOK := FALSE;
			Q_DruckerStart := Not I_Nachpressen;
		END_IF;


		IF I_ZylLinksGs AND I_ZylRechtsGs THEN
			Q_ZylLinksGs := FALSE;
			Q_ZylRechtsGs := FALSE;
			iStep := 0;
		END_IF;
END_CASE;
